INSERT INTO `js_sys_log` VALUES ('1067350914532143104', 'access', '业务管理/问题', 'system', '超级管理员', '2018-11-27 09:34:23', '/rxMgr/a/js/question/save', 'POST', 'id=&name=Decode the Morse code&score=8&description=In this kata you have to write a simple Morse code decoder. While the Morse code is now mostly superceded by voice and digital data communication channels, it still has its use in some applications around the world.\nThe Morse code encodes every character as a sequence of \"dots\" and \"dashes\". For example, the letter A is coded as ·−, letter Q is coded as −−·−, and digit 1 is coded as ·−−−−. The Morse code is case-insensitive, traditionally capital letters are used. When the message is written in Morse code, a single space is used to separate the character codes and 3 spaces are used to separate words. For example, the message HEY JUDE in Morse code is ···· · −·−−   ·−−− ··− −·· ·.\n\nNOTE: Extra spaces before or after the code have no meaning and should be ignored.\n\nIn addition to letters, digits and some punctuation, there are some special service codes, the most notorious of those is the international distress signal SOS (that was first issued by Titanic), that is code...&questionInit=decodeMorse = function(morseCode){\n  //your code here\n}&questionTasksList[0].id=&questionTasksList[0].status=0&questionTasksList[0].question.id=&questionTasksList[0].task=decodeMorse(\'.... . -.--   .--- ..- -.. .\')=HEY JUDE', NULL, '', 'Question', '0:0:0:0:0:0:0:1', 'http://localhost:8090', '0', '', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/70.0.3538.102 Safari/537.36', 'Windows 10', 'Chrome', 262, '0', 'JeeSite');
