INSERT INTO `js_sys_log` VALUES ('1090161877652029440', 'update', '业务管理/问题', 'system', '超级管理员', '2019-01-29 16:17:01', '/rxMgr/a/js/question/save', 'POST', 'id=&name=出现奇数次的数&score=12&description=输入一个数组,找到其中出现次数为奇数的数字;\n注意: 只有一个数字出现奇数次;&questionInit=function findOdd(A) {\n  //happy coding!\n  return 0;\n}&rightAnswer=function findOdd(A) {\n         return A.filter(\n            function (e,i,arr) {\n              var temp = 0;\n              for(var j in arr)\n              {\n                if(e==arr[j])\n                 temp++;\n              }\n              if(temp%2!=0)\n                return e;\n            }\n          )[0]\n}&questionTasksList[0].id=&questionTasksList[0].status=0&questionTasksList[0].questionId=&questionTasksList[0].taskQuestion=findOdd([20,1,-1,2,-2,3,3,5,5,1,2,4,20,4,-1,-2,5])&questionTasksList[0].taskAnswer=5&questionTasksList[1].id=&questionTasksList[1].status=0&questionTasksList[1].questionId=&questionTasksList[1].taskQuestion=findOdd([1,1,2,-2,5,2,4,4,-1,-2,5])&questionTasksList[1].taskAnswer=-1&questionTasksList[2].id=&questionTasksList[2].status=0&questionTasksList[2].questionId=&questionTasksList[2].taskQuestion=findOdd([20,1,1,2,2,3,3,5,5,4,20,4,5])&questionTasksList[2].taskAnswer=5&questionTasksList[3].id=&questionTasksList[3].status=0&questionTasksList[3].questionId=&questionTasksList[3].taskQuestion=findOdd([5,4,3,2,1,5,4,3,2,10,10])&questionTasksList[3].taskAnswer=1', NULL, '', 'Question', '0:0:0:0:0:0:0:1', 'http://localhost:8090', '0', '', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/71.0.3578.98 Safari/537.36', 'Windows 10', 'Chrome', 37, '0', 'JeeSite');
